function App() {
  const status = [
    {
      title: "Status 1",
      id: 1,
    },
    {
      title: "New",
      id: 2,
    },
    {
      title: "Working",
      id: 3,
    },
    {
      title: "Status 1",
      id: 4,
    },
    {
      title: "Status 1",
      id: 5,
    },
  ];

  return (
    <div className="bg-gray-200 h-full py-16">
      <div className="bg-white rounded shadow-inner grid justify-items-center h-20 w-9/12 mx-auto">
        <div className="w-full flex justify-center m-auto gap-x-10">
          {status.map((item, i, id) => {
            return (
              <div
                className={`${id == 1 && "bg-green"} h-10 w-60 cursor-pointer border border-gray-500 flex justify-center items-center font-semibold`}
                key={i}
              >
                {item.title}
              </div>
            );
          })}
        </div>
      </div>
    </div>
  );
}

export default App;
